var that = this;
var container = $("<div>");

function buildGroup(groupKey, groupDisplayName, stylingForItems) {
    var group = $("<div>").html(groupDisplayName).css({"font-size": "15px"});
    var table = $("<table>").css({"width":"100%","border-spacing": "5px", "border-collapse": "separate"});

    var numOfItems = 0;
    var row = $("<tr>");

    //lets loop through all props provided via datasource
    $.each(that.datasource, function (propName, value) {
        //first check group
        if (propName in displayOptionsForKey) {
            if (!displayOptionsForKey[propName].ignore) {
                if (displayOptionsForKey[propName].group === groupKey) {
                    //see if we need to make a new row
                    if (numOfItems > 0 && numOfItems % maxPerRow === 0) {
                        //append the existing row
                        table.append(row);
                        row = $("<tr>");
                    }
                    var dispVal = "";
                    if (that.datasource[propName] !== undefined && that.datasource[propName] !== null && that.datasource[propName] !== "undefined") {
                        dispVal = that.datasource[propName];
                    }
                    var cell = $("<td>").html(displayOptionsForKey[propName].displayName + ": " + dispVal);
                    cell.css(stylingForItems);
                    if (displayOptionsForKey[propName].icon) {
                        cell.append($("<i class=" + displayOptionsForKey[propName].icon + " aria-hidden='true'></i>").css("float", "right"));
                    }
                    row.append(cell);
                    numOfItems++;
                }
            }
        } else {
            //no options defined, treat as custom
            if (groupKey === "custom") {
                if (numOfItems > 0 && numOfItems % maxPerRow === 0) {
                    //append the existing row
                    table.append(row);
                    row = $("<tr>");
                }
                var cell = $("<td>").html(propName + ": " + that.datasource[propName]);
                cell.css(stylingForItems);
                row.append(cell);
                numOfItems++;
            }
        }
    });

    table.append(row);
    group.append(table);
    return group;
}

